import React from "react";
import Todos from "../models/Todo";
import TodoItem from "./TodoItem";
const Todo: React.FC<{ item: Todos[] }> = (props) => {
  return (
    <ul>
      {props.item.map((item) => (
          <TodoItem key={item.id}>{item.text}</TodoItem>
        
      ))}
    </ul>
  );
};
export default Todo;
